objetoCompra:
Locação de Espaço com Capacidade para 150 (cento e cinquenta) pessoas sentadas e que possua:
•	Luz ambiente adequada para a ocasião, a ser providenciada pelo próprio espaço;
•	Equipamentos de som, microfones e data show no auditório;
•	Sinal de Wi-Fi disponível e gratuito para todos os presentes do evento, com velocidade de no mínimo 100mb;
•	Banheiros;
•	Água e Café a ser providenciada pelo próprio espaço;

O serviço de buffet será para o quantitativo de 100 pessoas, que deverá ser servido durante todo o evento, contemplando os seguintes itens: Coffe break (salgadinhos variados, bolos doces e salgados, tortas, suco e refrigerante) para 100 pessoas, a ser servido no dia do evento (horário a combinar); Almoço para 50 pessoas, a ser servido meio-dia, para os profissionais de psicologia convidados pelo CRP-21ª.
